import React, {Component} from 'react';
import './Contact.css';

class Contact extends Component{
    render() {
        return(
            <div id="contact-section">
                <div className="row">
                    <div className="col-md-12">
                        <h2 id="contact-title">Entre em Contato</h2>
                    </div>
                </div>
            </div>
        )
    }
}

export default Contact;
